export default function Button({ children, className, ...props }) {
    return (
        <button
            {...props}
            className={`w-full bg-indigo-600 text-white px-6 py-3 rounded-md hover:bg-indigo-700 transition duration-200 font-medium ${className}`}
        >
            {children}
        </button>
    );
}
